webpackJsonp([0xd40436c3b983],{4130:function(l,i){l.exports={data:{markdownRemark:{html:"<p>3年弱使い続けたケータイ、auのW21SAが故障した(厳密には充電器差し込む端子部の破損で通信通話は出来るがバッテリー切れたら終わりな状況だった)ため、先週やっとW43Hに機種変更。今まで半年～1年弱程度に1回機種変更してたので今回間違いなく自己最長記録だな。 そういえばウチが最初に持ったケータイがドコモのD207だっけ、懐かしい… まぁそれはさておき、ちょこっと使ってみた感想。</p>\n<ul>\n<li>Felica普通に便利だなー。これは良いと思った。これのおかげでSuica要らなくなった。Edyの登録にウチのクレジットカード(MASTER)が使えないのは凹んだけど。</li>\n<li>Opera内蔵いいなぁ。ついにケータイでもJavascriptが動くようになったか。動作がちょい重いから必要に迫られたときしか使ってないけどね。</li>\n<li>スケジュールアラームが60分前までしか設定出来ないのがひどす。もう自前でリマインダー作ってやろうかと思ったが、んな暇ねぇよ orz</li>\n<li>まだ1回しか見てないが、ワンセグすげぇって思った俺やっぱ一世代前だなぁ。</li>\n<li>今まで使えてた1.5MB以上の着うたが再生できなくなった。まぁ着うたフルがなかなかいい感じに便利だったのが救いだが。</li>\n<li>変換元がWAVとWMAだけっての何とかして欲しいな。せめてMP3対応きぼん。</li>\n<li>サイドボタンを押すと現在時刻を音声で知らせてくれるのはSANYO独自機能なのかなぁ。あれ凄い便利だったのに orz</li>\n<li>microSD差し込むのにわざわざ電源落とさなきゃいかんのかよ orz</li>\n<li>メール振り分け機能が貧弱。振り分け対象にアドレスしか指定できない。最低でも件名振り分けは欲しいと思った。</li>\n<li>日立いつの間にスライドスイッチでマナーモード切替する機能やめたんか？</li>\n<li>データフォルダのユーザフォルダは多層フォルダ対応にして欲しかったが、未だそんなケータイ見たことないんでまぁそこは諦めるしかないか。</li>\n<li>BREWオープン化きぼんぬ。勝手アプリの締め出しいい加減にすれ。</li>\n<li>オープン用にBREW上で動くJavaを公開するらしいが、速度が期待できない。そんなんだったら未承諾のBREWは一部機能規制だけでいいじゃん。</li>\n<li>つかBREWで使えるのにオープンJavaでSOCKETが使えないのは嫌がらせ？\n……だんだんW43Hのインプレからauの愚痴に変わってきたのでこの辺で。なんかこの機種はあんまり長続きしそうにないなぁ 'Ａ｀ (いや、それでも最低1年は使い倒すけどね)</li>\n</ul>",frontmatter:{cover:null,date:"2007-02-02T19:35:00+09:00",strDate:"2007/2/2",title:"ケータイ機種変更3年ぶり(W43Hレビュー)"}}},pathContext:{path:"/ja/blog/2007/02/02-ケータイ機種変更3年ぶりw43hレビュー/",langKey:"ja"}}}});
